<template>
  <div>
    <div class="row profile-menu">
      <router-link
        to="/profile/edit"
        class="btn btn-success btn-md">
        <img
          :src="edit_user_img"
          class="img_resize"
          style="height:25px;width:25px;">
        Edit profile
      </router-link>
      &nbsp;
      <router-link
        to="/profile/delete"
        class="btn btn-danger btn-md">
        <img
          :src="delete_user_img"
          class="img_resize"
          style="height:25px;width:25px;">
        Delete profile
      </router-link>
      &nbsp;
      <router-link
        to="/profile/lock"
        class="btn btn-warning btn-md">
        <img
          :src="lock_user_img"
          class="img_resize"
          style="height:25px;width:25px;">
        Lock profile
      </router-link>
    </div>
    <br>
    <div class="row">
      <div id="col-md-2 user_photo">
        <img
          :src="photo"
          v-bind="photo"
          class="img_resize"
          style="height:250px;width:250px;">
      </div>
      <div class="col-md-8 profile_info">
        <div class="row">
          Username: {{ username }}
        </div>
        <div class="row">
          Name: {{ first_name }} {{ last_name }}
        </div>
        <div class="row">
          Email: {{ email }}
        </div>
        <div class="row">
          Birthday: {{ birthday }}
        </div>
        <div class="row">
          Storage available: {{ storage_available }}
        </div>
        <div class="row">
          Storage used compressed: {{ data_stored }} bytes
        </div>
        <div class="row">
          Storage if no compression: {{ data_stored_no_compression }} bytes
        </div>
        <div class="row">
          Last login: {{ last_login }}
        </div>
        <div class="row">
          Last edited profile: {{ last_edited }}
        </div>
      </div>
    </div>
  </div>
</template>
<script>
import { mapState, mapActions } from 'vuex'
export default {

  name: 'Profile',
  data () {
    return {
      username: '',
      first_name: '',
      last_name: '',
      email: '',
      photo: '',
      last_login: '',
      last_edited: '',
      birthday: '',
      role: false,
      data_stored: '',
      data_stored_no_compression: '',
      storage_available: '',
      no_photo: 'data:image/png;base64,',
      delete_user_img: 'data:image/png;base64,',
      lock_user_img: 'data:image/png;base64, ',
      edit_user_img: 'data:image/png;base64,',
    }
  },
  computed: {
    ...mapState('users', ['status'])
  },
  created() {
    this.getProfile()
  },
  methods: {
    ...mapActions('users', ['getByToken']),
    ...mapActions('files', ['computeSize']),

    getProfile() {
      var token = localStorage.getItem('token')
      this.getByToken(token)
        .then(
          user => {
            this.username = user.getUsername()
            this.first_name = user.getFirstName()
            this.last_name = user.getLastName()
            this.email = user.getEmail()
            this.last_login = user.getLastLogin().substring(0, 10)
            this.last_edited = user.getLastEdited().substring(0, 10)
            this.birthday = user.getBirthday().substring(0, 10)
            if (user.getPhoto() == '') {
              this.photo = this.no_photo
            } else {
              this.photo = decodeURIComponent(escape(atob( user.getPhoto())))
            }
          })
      this.computeSize().then(
        rsp => {
          this.data_stored_no_compression = rsp.getInitialSize()
          this.data_stored = rsp.getCompressedSize()
        }
      )
    },
    get_photo() {
      return this.photo
    }

  }
}
</script>

