.user_photo{
  align-content: flex-start;
}
.profile_info{
  margin-left: 5%;
}
.edit-button{
  background: green;
}
.delete-button{
  background: red;
}
.lock-button{
  background: blue;
}
.profile-menu{
  margin-top: 10px;
}
</style>
